 Sure, here's an example of how you can server a ReactJS app from a simple ExpressJS server using Typescript:

**server.ts**
```typescript
import express from "express";
import React from "react";
import ReactDOMServer from "react-dom/server";

const app = express();
app.use(express.static(__dirname));

const Greet = () => <div>Hello, world!</div>;

app.get("/", (req, res) => {
  const html = ReactDOMServer.renderToString(<Greet />);
  res.send(`
    <html>
      <head>
        <title>ReactJS App</title>
      </head>
      <body>
        <div id="root">${html}</div>
      </body>
    </html>
  `);
});

app.listen(3000, () => {
  console.log("Server listening on port 3000");
});
```
In this example, we create a simple ExpressJS server that serves static files from the current directory. Then, we render a React component and return the result as HTML to the client. The expression `const html = ReactDOMServer.renderToString(<Greet />);` converts the React component into a string of HTML.

