 Here is an example of how you can use JavaScript to display Pascal's triangle in an HTML canvas:
```
<canvas id="pascal"></canvas>

<script>
  const canvas = document.getElementById('pascal');
  const ctx = canvas.getContext('2d');

  // Set the size of the canvas
  canvas.width = 500;
  canvas.height = 500;

  // Draw the first row of Pasca's triangle
  drawRow(0);

  // Draw the remaining rows of Pasca's triangle
  for (let i = 1; i < 10; i++) {
    drawRow(i);
  }

  function drawRow(row) {
    // Calculate the number of elements in the row
    const numElems = Math.pow(2, row);

    // Draw the row
    ctx.strokeStyle = 'black';
    ctx.fillStyle = 'black';
    for (let i = 0; i < numElems; i++) {
      const x = i * 50;
      const y = row * 50;
      const num = row == 0 ? 1 : i + row * 2;
      drawCell(x, y, num);
    }
  }

  function drawCell(x, y, num) {
    // Calculate the value of the cell
    const value = (i ? i : num < 0 ? 0 : num)

    // Draw the cell
    ctx.startPath();
    ctx.arc(x, y, 25, 0, 2 * Math.PI);
    ctx.stroke();
    ctx.fillText(value.toString(), x, y + 30);
  }
</script>
```
This will create a canvas element on the page and then use JavaScript to draw the first row of Pascal's triangle, and then each subsequent row up to a maximum of 10 rows.

