 Here is a simple example of reading packets from a socket in C++:
```c++
#include <iostream>
#include <string>
#include <memory>
#include <cstring>
#include <cstdlib>
#include <arpa/inet.h>

using namespace std;

int main()
{
    int sock = socket(AF_INET, SOCK_STREAM, 0);
    if (sock == -1) {
        cerr << "Error creating socket." << endl;
        return 1;
    }

    sockaddr_in addr = {0};
    addr.sin_family = AF_INET;
    addr.sin_port = htons(888);
    inet_pton(AF_INET, "127.0.0.1", &addr.sin_addr);

    if (connect(sock, (sockaddr*)&addr, sizeof(addr)) == -1) {
        cerr << "Error connecting to server." << endl;
        return 1;
    }

    char buffer[1024] = {0};
    int bytesRead = 0;

    while (true) {
        if ((bytesRead = read(sock, buffer, sizeof(buffer)-1)) == -1) {
            cerr << "Error reading from socket." << endl;
            break;
        }

        buffer[bytesRead] = '\0';

        cout << "Received: " << buffer << endl;
    }

    close(sock);

    return 0;
}
```
